  BrowserRouter,
  Route
} from 'react-router-dom'

function App() {


  return (
    <BrowserRouter>
    <div>
    <h1>_COVID WATCH</h1>
    <h6>an <strong>unfortunate name</strong> for an <strong>awesome app</strong></h6>

    <Route exact path='/' component={Home}/>
    <Route path='/USA' component={Country}/>

    </div>
    </BrowserRouter>

  );
}

export default App;
